  false,\n\t\"url\": null,\n\t\"notes\": \"Watershed Sciences, Inc. collected Light
  Detection and Ranging (LiDAR) data for the Oregon Department of Geology and Mineral
  Industries (DoGAMI) and the Oregon Department of Forestry (ODF) between March 15
  and November 7 2007. This data set has bare earth and unclassified points. The dataset
  encompasses portions of the following counties in northwest Oregon: Multnomah, Marion,
  Hood River, Clackamas, Columbia, Washington and Yamhill. Areas of interest within
  this data set are the Portland Metro area, Mt. Hood and Silver Falls State Park.
  There is approximately 8 points per square meter over terrestrial surfaces. In some
  areas of heavy vegetation or forest cover, there may be relatively few ground points
  in the LiDAR data. Elevation values for open water surfaces are not valid elevation
  values because few LiDAR points are returned from water surfaces. Lidar intensity
  values were also collected.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
